(ns opencv3.threshold
  (:require
    [opencv3.core :refer :all]
    [opencv3.utils :as u]))

(def neko
  (->
  "resources/images/cat.jpg"
  imread
  (u/resize-by 0.2)))
(u/mat-view neko)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"320\" height=\"240\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x4557a847 \"BufferedImage@4557a847: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7bfe4554 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 320 height = 240 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
(def factor 6)
(def background (new-mat))
(def work (clone neko))

(dotimes [_ factor] (pyr-down! work))
(bilateral-filter work background 9 9 7)
(dotimes [_ factor] (pyr-up! background))
(resize! background (new-size (.cols neko) (.rows neko)))
(u/mat-view background)

;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"320\" height=\"240\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x10e4908 \"BufferedImage@10e4908: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7bfe4554 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 320 height = 240 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@

(def
  c
  (-> neko
  clone
  (blur! (new-size 3 3))
  (cvt-color! COLOR_BGR2GRAY)
  (canny! 300.0 100.0 3 true)
  (bitwise-not!)
  (cvt-color! COLOR_GRAY2BGR)  ))
(u/mat-view c)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"320\" height=\"240\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x450bdef4 \"BufferedImage@450bdef4: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7bfe4554 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 320 height = 240 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
(let [result (new-mat) ]
  (bitwise-and background c result)
  (u/mat-view result))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"320\" height=\"240\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0xcb317e4 \"BufferedImage@cb317e4: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7bfe4554 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 320 height = 240 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
(def t
(-> neko
  clone
  (blur! (new-size 3 3))
  (cvt-color! COLOR_BGR2GRAY)
  (threshold! 150 255 THRESH_BINARY_INV)
  (cvt-color! COLOR_GRAY2BGR)  ))

(let [result (new-mat) ]
  (bitwise-and background t result)
  (u/mat-view result))
